class Solution:
    def findLargestCircle(self, matrix: List[List[str]]) -> int:
        rows = len(matrix)
        cols = len(matrix[0])

        if rows == 0 or cols == 0:
            return -1

        for i in range(rows):
            for j in range(cols):
                if matrix[i][j] != '.':
                    break

        if i == rows-1 and j == cols-1:
            return 1

        left = right = top = bottom = i + 1
        max_radius = 0
        while True:
            for x in range(left, right+1):
                for y in range(top, bottom+1):
                    if matrix[x][y] != '.':
                        break
            else:
                max_radius = max(max_radius, (right-left)*(bottom-top))
                left += 1
            for x in range(right-1, left-1, -1):
                for y in range(bottom-1, top-1, -1):
                    if matrix[x][y] != '.':
                        break
            else:
                max_radius = max(max_radius, (right-left)*(bottom-top))
                right -= 1
            for x in range(left, right+1):
                for y in range(top-1, bottom-1, -1):
                    if matrix[x][y] != '.':
                        break
            else:
                max_radius = max(max_radius, (right-left)*(bottom-top))
                top -= 1
            for x in range(left-1, right+1, 1):
                for y in range(top, bottom+1):
                    if matrix[x][y] != '.':
                        break
            else:
                max_radius = max(max_radius, (right-left)*(bottom-top))
                bottom += 1

            if left >= right or top >= bottom:
                break

        return max_radius
