class Solution:
    def removeDuplicateLetters(self, s: str) -> str:
        if not s or len(s) == 0:
            return s

        result = ''
        count_dict = {}
        for char in s:
            if char.isalpha():
                count_dict[char] = count_dict.get(char, 0) + 1
            else:
                continue

        for char, count in sorted(count_dict.items()):
            if count > 1 and char != '.':
                while count > 1:
                    result += char
                    count -= 1

        return result
